";s:4:"name";s:10:"Ольга";s:5:"image";s:0:"";s:8:"position";s:0:"";s:4:"text";s:460:"Здравствуйте. У меня 30 неделя  беременности. Вчера после прогулки прихватило низ живота с небольшой болью, тянуло. Пролежала 2 часа - отпустило. Таблетки не  пила. Сегодня днем были больные шевеления малыша. Сейчас тянет низ живота когда стою. Что делать?";s:5:"files";s:0:"";s:4:"date";s:21:"3 февраля 2020";}s:6:"answer";a:8:{s:5:"title";s:10:"Ответ";s:4:"name";s:8:"МЦРМ";s:5:"image";a:2:{s:8:"ORIGINAL";s:29:"/upload/images/logo-short.png";s:7:"resized";s:29:"/upload/images/logo-short.png";}s:8:"position";s:0:"";s:4:"text";s:112:"Постоять под тёплым душем, если не отпустит, показаться врачу";s:5:"files";s:0:"";s:4:"date";s:21:"3 февраля 2020";s:13:"specialist_id";s:0:"";}}}s:4:"path";s:18:"/patients/consult/";}}';
